var ETH = big.NewInt(1e18)

var BlockReward = int64(1)

func GetBlockCoinbaseReward(coinbase string) *big.Int {
	coinbase = strings.ToLower(coinbase)
	reward := new(big.Int).Mul(big.NewInt(BlockReward), ETH)
	return reward
}

func WeiToEth(w *big.Int) float64 {
	if w == nil {
		return 0
	}
	f, _ := new(big.Float).Quo(new(big.Float).SetInt(w), new(big.Float).SetInt(ETH)).Float64()
	return f
}

func EthToWei(f float64) *big.Int {
	newInt := new(big.Int)
	new(big.Float).Mul(new(big.Float).SetFloat64(f), new(big.Float).SetInt(ETH)).Int(newInt)
	return newInt
}
